import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Paper,
  Typography,
  Box,
  Button
} from '@mui/material';
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from 'recharts';
import axios from 'axios';

function Dashboard() {
  const [stats, setStats] = useState(null);
  const [latestArticles, setLatestArticles] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('all');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [statsRes, articlesRes] = await Promise.all([
          axios.get('http://localhost:5000/api/stats'),
          axios.get('http://localhost:5000/api/latest')
        ]);

        setStats(statsRes.data);
        setLatestArticles(articlesRes.data);
      } catch (error) {
        console.error('Fejl ved hentning af data:', error);
      }
    };

    fetchData();
  }, []);

  const formatPoliticalData = (data) => {
    if (!data?.political_bias || !data?.categories) return [];

    if (selectedCategory === 'all') {
      return Object.entries(data.political_bias).map(([name, value]) => ({
        name,
        bias: value * 100
      }));
    }

    return data.categories[selectedCategory]
      .map(name => ({
        name,
        bias: data.political_bias[name] * 100
      }));
  };

  const formatReliabilityData = (data) => {
    if (!data?.reliability_score || !data?.categories) return [];

    if (selectedCategory === 'all') {
      return Object.entries(data.reliability_score).map(([name, value]) => ({
        name,
        score: value * 100
      }));
    }

    return data.categories[selectedCategory]
      .map(name => ({
        name,
        score: data.reliability_score[name] * 100
      }));
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={3}>
        {/* Kategori vælger */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <Box sx={{ display: 'flex', gap: 2 }}>
              <Button
                variant={selectedCategory === 'all' ? 'contained' : 'outlined'}
                onClick={() => setSelectedCategory('all')}
              >
                Alle Medier
              </Button>
              {stats?.categories && Object.keys(stats.categories).map(category => (
                <Button
                  key={category}
                  variant={selectedCategory === category ? 'contained' : 'outlined'}
                  onClick={() => setSelectedCategory(category)}
                >
                  {category}
                </Button>
              ))}
            </Box>
          </Paper>
        </Grid>

        {/* Politisk bias graf */}
        <Grid item xs={12} md={6}>
          <Paper
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              height: 400,
            }}
          >
            <Typography component="h2" variant="h6" color="primary" gutterBottom>
              Politisk Orientering
            </Typography>
            <ResponsiveContainer>
              <BarChart
                data={formatPoliticalData(stats)}
                margin={{
                  top: 5,
                  right: 30,
                  left: 20,
                  bottom: 5,
                }}
                layout="vertical"
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis type="number" domain={[-100, 100]} />
                <YAxis type="category" dataKey="name" width={100} />
                <Tooltip />
                <Legend />
                <Bar dataKey="bias" fill="#8884d8" name="Politisk Bias" />
              </BarChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>

        {/* Pålideligheds score graf */}
        <Grid item xs={12} md={6}>
          <Paper
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              height: 400,
            }}
          >
            <Typography component="h2" variant="h6" color="primary" gutterBottom>
              Pålidelighedsscore
            </Typography>
            <ResponsiveContainer>
              <BarChart
                data={formatReliabilityData(stats)}
                margin={{
                  top: 5,
                  right: 30,
                  left: 20,
                  bottom: 5,
                }}
                layout="vertical"
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis type="number" domain={[0, 100]} />
                <YAxis type="category" dataKey="name" width={100} />
                <Tooltip />
                <Legend />
                <Bar dataKey="score" fill="#82ca9d" name="Pålidelighed" />
              </BarChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>

        {/* Seneste artikler */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <Typography component="h2" variant="h6" color="primary" gutterBottom>
              Seneste Analyserede Artikler
            </Typography>
            <Box sx={{ mt: 2 }}>
              {latestArticles.map((article, index) => (
                <Box key={index} sx={{ mb: 2 }}>
                  <Typography variant="subtitle1" component="div">
                    {article.title}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {article.source}
                  </Typography>
                </Box>
              ))}
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Dashboard;
